literals:
position: absolute;
  left: 0;
  right: 0;
  height: 6rem;
  z-index: 1;

max-width: 1200px;
  margin: 0 auto;
  display: flex;
  align-items: center;
  height: 100%;
  justify-content: space-between;

ul {
    list-style: none;
    padding: 0;

    li {
      margin-left: 3rem;
      display: inline-block;

      a {
        text-decoration: none;
        color: ${theme.color.textDark};

        &:hover {
          color: ${theme.color.link};
        }
      }
    }
  }
